import React, { Component } from 'react'
import './Checkbox.css'

class Checkbox extends Component {
    constructor(props){
        super(props)
    }

    render() {
        return (
            <section>
                <input
                    type="checkbox"
                    name="hack"
                    id="hack"
                    value="hack"/>
                <label 
                    className="checkbox-selectItens"
                    htmlFor="hack">
                        Hack
                    </label>

            </section>
        )
    }
}

export default Checkbox
